3c- as.factor(combined$Fare) #add fare factor column\nrpart.plot(model_fare$finalModel)\n\n#####\n###Replacing EMBARKED\n#####\n\nwhich(is.na(combined$Embarked))\ncombined[62, \u0022Embarked\u0022] \u003c- \u0027C\u0027\ncombined[830, \u0022Embarked\u0022] \u003c- \u0027C\u0027\n\n# New Variable: Title\ncombined$Title \u003c- gsub(\u0027(.*, )|(\\\\..*)\u0027, \u0027\u0027, combined$Name)\ntable(combined$Sex, combined$Title)\n\n# Reassign titles\nofficer \u003c- c(\u0027Capt\u0027, \u0027Col\u0027, \u0027Don\u0027, \u0027Dr\u0027, \u0027Major\u0027, \u0027Rev\u0027)\nroyalty \u003c- c(\u0027Dona\u0027, \u0027Lady\u0027, \u0027the Countess\u0027,\u0027Sir\u0027, \u0027Jonkheer\u0027)\n\ncombined$Title[combined$Title == \u0027Mlle\u0027] \u003c- \u0027Miss\u0027 \ncombined$Title[combined$Title == \u0027Ms\u0027] \u003c- \u0027Miss\u0027\ncombined$Title[combined$Title == \u0027Mme\u0027] \u003c- \u0027Mrs\u0027 \ncombined$Title[combined$Title %in% royalty] \u003c- \u0027Royalty\u0027\ncombined$Title[combined$Title %in% officer] \u003c- \u0027Officer\u0027\n\n# New Variable: Family Size\ncombined$FamilySize \u003c- combined$SibSp + combined$Parch + 1\n\nggplot(combined, aes(Pclass, fill=!is.na(Age))) + geom_bar(position=\u0022dodge\u0022) + labs(title=\u0022Passenger Has Age\u0022,fill=\u0022Has Age\u0022) #  We decide at this point to dismiss Age information for Pclass 3. Having to complete a large percentage of missing values may add more noise to the prediction system for a goal of better than 80% accuracy.\n\nggplot(combined[tr_idx,] %\u003e% filter(Pclass!=3), aes(Age)) + geom_density(alpha=0.5, aes(fill=factor(Survived))) + labs(title=\u0022Survival density per Age for Pclass 1 and 2\u0022)\n\nchild \u003c- 14\ncombined$Minor \u003c- ifelse(combined$Age\u003cchild\u0026combined$Pclass!=3, 1, 0)\ncombined$Minor \u003c- ifelse(is.na(combined$Minor), 0, combined$Minor)\n\n\n# Factorise and ready to model\ncombined$Survived \u003c- as.factor(combined$Survived)\ncombined$Pclass \u003c- as.factor(combined$Pclass)\ncombined$Sex \u003c- as.factor(combined$Sex)\ncombined$Title \u003c- as.factor(combined$Title)\ncombined$Minor \u003c- as.factor(combined$Minor)\ncombined$Embarked \u003c- as.factor(combined$Embarked)\ncombined$Fare \u003c- as.double(combined$Fare)\n\nglimpse(combined)\n\n# Back into train and test\ntrain \u003c- combined[tr_idx,]\ntest \u003c- combined[-tr_idx,]\n\n# Keep wanted columns\ntrain \u003c- train[, c(\u0027Survived\u0027, \u0027Pclass\u0027, \u0027Sex\u0027, \u0027Fare\u0027, \u0027Embarked\u0027,\u0027Title\u0027, \u0027FamilySize\u0027, \u0027Minor\u0027)]\ntest \u003c- test[, c(\u0027Survived\u0027, \u0027Pclass\u0027, \u0027Sex\u0027, \u0027Fare\u0027, \u0027Embarked\u0027,\u0027Title\u0027, \u0027FamilySize\u0027, \u0027Minor\u0027, \u0027PassengerId\u0027)]\n#Partition\np_idx \u003c- createDataPartition(train$Survived, p = 0.7, list = F)\np_train \u003c- train[p_idx, ]\np_test \u003c- train[-p_idx, ]\n# Model\n#cl \u003c- makeCluster(5, type = \u0027SOCK\u0027)\n#registerDoSNOW(cl)\nglimpse(p_train)\n\nmodel_rf \u003c- randomForest(Survived ~ ., data=train, importance=TRUE, proximity=TRUE, do.trace=TRUE)\n \n#stopCluster(cl)\n\nsummary(model_rf)\n\ntest$Survived \u003c- predict(model_rf, test)\n\nsubmit \u003c- data.frame(PassengerId = test$PassengerId, Survived = test$Survived)\n\nwrite.csv(submit, \u0027submit.csv\u0027, row.names = F)\n\n","dateCreated":"2019-03-24T10:46:14.9671744Z"},"kernelRun":{"id":12002309,"kernelId":3359554,"status":"complete","type":"batch","sourceType":"script","language":"r","title":"Titanic Random Forest (~.80)","dateCreated":"2019-03-24T10:46:15.047Z","dateEvaluated":"2019-03-24T10:46:15.39Z","workerContainerPort":null,"workerUptimeSeconds":174229,"workerIPAddress":"172.20.68.87   ","scriptLanguageId":1,"scriptLanguageName":"R","renderedOutputUrl":null,"commit":{"id":234182438,"settings":{"dockerImageVersionId":null,"dataSources":[{"sourceType":"Competition","sourceId":313 nfareMiss \u003c- which(is.na(combined$Fare)) #missing fare row\n\nmodel_fare \u003c- train(Fare ~ Pclass + Sex + Embarked + SibSp + Parch, data = combined %\u003e% filter(!is.na(Fare)),trControl = trControl,method = \u0027rpart\u0027,na.action = na.pass,tuneLength = 5)\n\ncombined$Fare[fareMiss] = predict(model_fare, combined[fareMiss,]) #predict missing fare\ncombined$Fare \u003c- as.factor(combined$Fare) #add fare factor column\nrpart.plot(model_fare$finalModel)\n\n#####\n###Replacing EMBARKED\n#####\n\nwhich(is.na(combined$Embarked))\ncombined[62, \u0022Embarked\u0022] \u003c- \u0027C\u0027\ncombined[830, \u0022Embarked\u0022] \u003c- \u0027C\u0027\n\n# New Variable: Title\ncombined$Title \u003c- gsub(\u0027(.*, )|(\\\\..*)\u0027, \u0027\u0027, combined$Name)\ntable(combined$Sex, combined$Title)\n\n# Reassign titles\nofficer \u003c- c(\u0027Capt\u0027, \u0027Col\u0027, \u0027Don\u0027, \u0027Dr\u0027, \u0027Major\u0027, \u0027Rev\u0027)\nroyalty \u003c- c(\u0027Dona\u0027, \u0027Lady\u0027, \u0027the Countess\u0027,\u0027Sir\u0027, \u0027Jonkheer\u0027)\n\ncombined$Title[combined$Title == \u0027Mlle\u0027] \u003c- \u0027Miss\u0027 \ncombined$Title[combined$Title == \u0027Ms\u0027] \u003c- \u0027Miss\u0027\ncombined$Title[combined$Title == \u0027Mme\u0027] \u003c- \u0027Mrs\u0027 \ncombined$Title[combined$Title %in% royalty] \u003c- \u0027Royalty\u0027\ncombined$Title[combined$Title %in% officer] \u003c- \u0027Officer\u0027\n\n# New Variable: Family Size\ncombined$FamilySize \u003c- combined$SibSp + combined$Parch + 1\n\nggplot(combined, aes(Pclass, fill=!is.na(Age))) + geom_bar(position=\u0022dodge\u0022) + labs(title=\u0022Passenger Has Age\u0022,fill=\u0022Has Age\u0022) #  We decide at this point to dismiss Age information for Pclass 3. Having to complete a large percentage of missing values may add more noise to the prediction system for a goal of better than 80% accuracy.\n\nggplot(combined[tr_idx,] %\u003e% filter(Pclass!=3), aes(Age)) + geom_density(alpha=0.5, aes(fill=factor(Survived))) + labs(title=\u0022Survival density per Age for Pclass 1 and 2\u0022)\n\nchild \u003c- 14\ncombined$Minor \u003c- ifelse(combined$Age\u003cchild\u0026combined$Pclass!=3, 1, 0)\ncombined$Minor \u003c- ifelse(is.na(combined$Minor), 0, combined$Minor)\n\n\n# Factorise and ready to model\ncombined$Survived \u003c- as.factor(combined$Survived)\ncombined$Pclass \u003c- as.factor(combined$Pclass)\ncombined$Sex \u003c- as.factor(combined$Sex)\ncombined$Title \u003c- as.factor(combined$Title)\ncombined$Minor \u003c- as.factor(combined$Minor)\ncombined$Embarked \u003c- as.factor(combined$Embarked)\ncombined$Fare \u003c- as.double(combined$Fare)\n\nglimpse(combined)\n\n# Back into train and test\ntrain \u003c- combined[tr_idx,]\ntest \u003c- combined[-tr_idx,]\n\n# Keep wanted columns\ntrain \u003c- train[, c(\u0027Survived\u0027, \u0027Pclass\u0027, \u0027Sex\u0027, \u0027Fare\u0027, \u0027Embarked\u0027,\u0027Title\u0027, \u0027FamilySize\u0027, \u0027Minor\u0027)]\ntest \u003c- test[, c(\u0027Survived\u0027, \u0027Pclass\u0027, \u0027Sex\u0027, \u0027Fare\u0027, \u0027Embarked\u0027,\u0027Title\u0027, \u0027FamilySize\u0027, \u0027Minor\u0027, \u0027PassengerId\u0027)]\n#Partition\np_idx \u003c- createDataPartition(train$Survived, p = 0.7, list = F)\np_train \u003c- train[p_idx, ]\np_test \u003c- train[-p_idx, ]\n# Model\n#cl \u003c- makeCluster(5, type = \u0027SOCK\u0027)\n#registerDoSNOW(cl)\nglimpse(p_train)\n\nmodel_rf \u003c- randomForest(Survived ~ ., data=train, importance=TRUE, proximity=TRUE, do.trace=TRUE)\n \n#stopCluster(cl)\n\nsummary(model_rf)\n\ntest$Survived \u003c- predict(model_rf, test)\n\nsubmit \u003c- data.frame(PassengerId = test$PassengerId, Survived = test$Survived)\n\nwrite.csv(submit, \u0027submit.csv\u0027, row.names = F)\n\n","dateCreated":"2019-03-24T10:46:14.9671744Z"},"resources":null,"isolatorResults":"\u003cresults\u003e\u003cdisk_kb_free\u003e4822424\u003c/disk_kb_free\u003e\u003cdocker_image_digest\u003ea cp\u003e\u003cb\u003e The training set \u003c/b\u003eshould be used to build your machine learning models. For the training set, we provide the outcome (also known as the ground truth) for each passenger. Your model will be based on features like passengers gender and class. You can also use \u003ca href=\u0022https://triangleinequality.wordpress.com/2013/09/08/basic-feature-engineering-with-the-titanic-data/\u0022 target=\u0022_blank\u0022\u003e feature engineering \u003c/a\u003eto create new features.\u003c/p\u003e\n\u003cp\u003e\u003cb\u003eThe test set \u003c/b\u003eshould be used to see how well your model performs on unseen data. For the test set, we do not provide the ground truth for each passenger. It is your job to predict these outcomes. For each passenger in the test set, use the model you trained to predict whether or not they survived the sinking of the Titanic.\u003c/p\u003e\n\u003cp\u003eWe also include \u003cb\u003egender_submission.csv\u003c/b\u003e, a set of predictions that assume all and only female passengers survive, as an example of what a submission file should look like.\u003c/p\u003e\n\u003ch3\u003eData Dictionary\u003c/h3\u003e\n\u003ctable style=\u0022width: 100%;\u0022\u003e\n\u003ctbody\u003e\n\u003ctr\u003e\u003cth\u003e\u003cb\u003eVariable\u003c/b\u003e\u003c/th\u003e\u003cth\u003e\u003cb\u003eDefinition\u003c/b\u003e\u003c/th\u003e\u003cth\u003e\u003cb\u003eKey\u003c/b\u003e\u003c/th\u003e\u003c/tr\u003e\n\u003ctr\u003e\n\u003ctd\u003esurvival\u003c/td\u003e\n\u003ctd\u003eSurvival\u003c/td\u003e\n\u003ctd\u003e0 = No, 1 = Yes\u003c/td\u003e\n\u003c/tr\u003e\n\u003ctr\u003e\n\u003ctd\u003epclass\u003c/td\u003e\n\u003ctd\u003eTicket class\u003c/td\u003e\n\u003ctd\u003e1 = 1st, 2 = 2nd, 3 = 3rd\u003c/td\u003e\n\u003c/tr\u003e\n\u003ctr\u003e\n\u003ctd\u003esex\u003c/td\u003e\n\u003ctd\u003eSex\u003c/td\u003e\n\u003ctd\u003e\u003c/td\u003e\n\u003c/tr\u003e\n\u003ctr\u003e\n\u003ctd\u003eAge\u003c/td\u003e\n\u003ctd\u003eAge in years\u003c/td\u003e\n\u003ctd\u003e\u003c/td\u003e\n\u003c/tr\u003e\n\u003ctr\u003e\n\u003ctd\u003esibsp\u003c/td\u003e\n\u003ctd\u003e# of siblings / spouses aboard the Titanic\u003c/td\u003e\n\u003ctd\u003e\u003c/td\u003e\n\u003c/tr\u003e\n\u003ctr\u003e\n\u003ctd\u003eparch\u003c/td\u003e\n\u003ctd\u003e# of parents / children aboard the Titanic\u003c/td\u003e\n\u003ctd\u003e\u003c/td\u003e\n\u003c/tr\u003e\n\u003ctr\u003e\n\u003ctd\u003eticket\u003c/td\u003e\n\u003ctd\u003eTicket number\u003c/td\u003e\n\u003ctd\u003e\u003c/td\u003e\n\u003c/tr\u003e\n\u003ctr\u003e\n\u003ctd\u003efare\u003c/td\u003e\n\u003ctd\u003ePassenger fare\u003c/td\u003e\n\u003ctd\u003e\u003c/td\u003e\n\u003c/tr\u003e\n\u003ctr\u003e\n\u003ctd\u003ecabin\u003c/td\u003e\n\u003ctd\u003eCabin number\u003c/td\u003e\n\u003ctd\u003e\u003c/td\u003e\n\u003c/tr\u003e\n\u003ctr\u003e\n\u003ctd\u003eembarked\u003c/td\u003e\n\u003ctd\u003ePort of Embarkation\u003c/td\u003e\n\u003ctd\u003eC = Cherbourg, Q = Queenstown, S = Southampton\u003c/td\u003e\n\u003c/tr\u003e\n\u003c/tbody\u003e\n\u003c/table\u003e\n\u003ch3\u003eVariable Notes\u003c/h3\u003e\n\u003cp\u003e\u003cb\u003epclass\u003c/b\u003e: A proxy for socio-economic status (SES)\u003cbr /\u003e 1st = Upper\u003cbr /\u003e 2nd = Middle\u003cbr /\u003e 3rd = Lower\u003cbr /\u003e\u003cbr /\u003e \u003cb\u003eage\u003c/b\u003e: Age is fractional if less than 1. If the age is estimated, is it in the form of xx.5\u003cbr /\u003e\u003cbr /\u003e \u003cb\u003esibsp\u003c/b\u003e: The dataset defines family relations in this way...\u003cbr /\u003e Sibling = brother, sister, stepbrother, stepsister\u003cbr /\u003e Spouse = husband, wife (mistresses and fiancs were ignored)\u003cbr /\u003e\u003cbr /\u003e \u003cb\u003eparch\u003c/b\u003e: The dataset defines family relations in this way...\u003cbr /\u003e Parent = mother, father\u003cbr /\u003e Child = daughter, son, stepdaughter, stepson\u003cbr /\u003e Some children travelled only with a nanny, therefore parc
